import React, { useEffect } from "react";
import { connect } from "react-redux";
import { fetchUsers } from "../redux/players/playerActions";

function Leaderboard({ userData, fetchUsers }) {
  useEffect(() => {
    fetchUsers();
  }, []);

  return userData.loading ? (
    <h2 className="h-screen bg-gray-900 flex justify-center items-center pt-10">
      loading...
    </h2>
  ) : userData.error ? (
    <h2>{userData.error}</h2>
  ) : (
    <div className="bg-gray-900 text-white bg-gray-900 flex justify-center items-center pt-10">
      <h2>List of users</h2>
      <div>
        {userData &&
          userData.users &&
          userData.users.map((element, key) => {
            return (
              <div
                key={key}
                className="p-5 border-2 border-solid border-bg-white"
              >
                <div>username: {element.userName} </div>
                <div>DURATION: {Math.round(element.duration / 1000)}</div>
                <div>length: {element.length} </div>
                <div>quoteId: {element.quoteId} </div>
                <div>uniqueCharacters: {element.uniqueCharacters} </div>

                <br />
              </div>
            );
          })}
      </div>
    </div>
  );
}

const mapStateToProps = (state) => {
  return {
    userData: state.player,
  };
};
const mapDispatchToProps = (dispatch) => {
  return {
    fetchUsers: () => dispatch(fetchUsers()),
  };
};
export default connect(mapStateToProps, mapDispatchToProps)(Leaderboard);

